  false,\n\t\"url\": null,\n\t\"notes\": \"The Department of Finance (DOF) maintains
  records for all property sales in New York City, including sales of family homes
  in each borough. This list is a summary of all neighborhood sales for Class 1-,
  2- and 3-Family homes Citywide in 2008.rnrnThis list includes all sales of 1-, 2-,
  and 3-Family Homes' from January 1st, 2008 to December 31, 2008, whose sale price
  is equal to or more than $150,000.  The Building Class Category for Sales is based
  on the Building Class at the time of the sale.\",\n\t\"license_title\": \"License
